import Navigation from './Navigation';
import { BrowserRouter,Routes,Route } from 'react-router-dom';
const TemplateAdmin = () => {
    return (

        <BrowserRouter>
        <div>
              
            <div className="Result" >
            <h1>Archive de document</h1>
            <div className="container">
                <div className="row">
                  
                   <Navigation/>


                    <div className=" border border-primary rounded col-10">
                           
                    </div>
                </div>
                </div>
             </div>

   
        </div>
        </BrowserRouter>
    );
};

export default TemplateAdmin;
